CREATE DATABASE IF NOT EXISTS sirene;

USE sirene;

CREATE SCHEMA IF NOT EXISTS sirene;

CREATE TABLE IF NOT EXISTS `etna` (
	  `siret` char(14) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
	  `siren` varchar(9) NOT NULL,
	  `nic` varchar(5) NOT NULL,
	  `nomen_long` varchar(131) NOT NULL,
	  `rpet` int(2) NOT NULL,
	  `nj` int(4) NOT NULL,
	  `libnj` varchar(200) NOT NULL,
	  `division` int(2) NOT NULL,
	  `ape` varchar(5) NOT NULL,
	  `libape` varchar(65) NOT NULL,
	  `dape` int(4) NOT NULL,
	  `tef` int(2) NOT NULL,
	  `libtef` varchar(50) NOT NULL,
	  `efcent` int(6) NOT NULL,
	  `def` int(4) NOT NULL,
	  `categorie` varchar(5) NOT NULL,
	  `dcr` varchar(8) NOT NULL,
	  `tca` int(1) NOT NULL,
	  `siege` varchar(14) DEFAULT NULL,
	  `is_siege` tinyint(1) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

